import React from 'react';
import '../../styles/styles1.css'; // Import the CSS file

const App = () => {
  return (
    <div className="container">
      <img src="your-image.jpg" alt="Image description" />
      <p>Your text content here</p>
    </div>
  );
};

export default App;
